member.example:
This sample shows how to call InputToInputOutputAsync with required parameters.

var client = new UsageClient();

var body = new InputModel("<name>");
var result = await client.InputToInputOutputAsync(body);

This sample shows how to call InputToInputOutput with required parameters.

var client = new UsageClient();

var body = new InputModel("<name>");
var result = client.InputToInputOutput(body);

This sample shows how to call InputToInputOutputAsync with required request content.

var client = new UsageClient();

var data = new {
    name = "<name>",
};

Response response = await client.InputToInputOutputAsync(RequestContent.Create(data));
Console.WriteLine(response.Status);

This sample shows how to call InputToInputOutput with required request content.

var client = new UsageClient();

var data = new {
    name = "<name>",
};

Response response = client.InputToInputOutput(RequestContent.Create(data));
Console.WriteLine(response.Status);

This sample shows how to call OutputToInputOutputAsync.

var client = new UsageClient();

var result = await client.OutputToInputOutputAsync();

This sample shows how to call OutputToInputOutput.

var client = new UsageClient();

var result = client.OutputToInputOutput();

This sample shows how to call OutputToInputOutputAsync with required parameters and parse the result.

var client = new UsageClient();

Response response = await client.OutputToInputOutputAsync(new RequestContext());

JsonElement result = JsonDocument.Parse(response.ContentStream).RootElement;
Console.WriteLine(result.GetProperty("name").ToString());

This sample shows how to call OutputToInputOutput with required parameters and parse the result.

var client = new UsageClient();

Response response = client.OutputToInputOutput(new RequestContext());

JsonElement result = JsonDocument.Parse(response.ContentStream).RootElement;
Console.WriteLine(result.GetProperty("name").ToString());
